import { Link } from "react-router-dom"

function Details(){

    return(
        <div>
            <p>{id} Unicorn vinyl poutine brooklyn, next level direct trade iceland. Shaman copper mug church-key coloring book, whatever poutine normcore Edison bulb direct trade gentrify beard lo-fi seitan sustainable roof party franzen occupy squid. Knausgaard cronut succulents, scenester readymade shabby chic lyft. Copper mug meh vegan gentrify. fixie cred kickstarter post-ironic street art.</p>
            <h3><Link to='/'>Back</Link></h3>
        </div>
    )
}
export default Details
